	var showTooltip = function(e, svg){

		if ($(svg).hasClass('svg-item--active')) {

			var elem_id = $(e).attr('data-elem_id');

			$('.btn.btn-large.btn-primary.add2basket').attr('data-id',elem_id);

			$('.svg-tooltip').hide();

			var name = $(e).find('.cards-items_item__code').html();

			$('.js-tooltip-name').html(name);

			var info = $(e).find('.cards-items_item__name').html();

			$('.js-tooltip-info').html(info);

			var price = $(e).find('.cards-items_item__price').html();

			$('.js-tooltip-price').html(price);

			var height = $(svg).get(0).getBoundingClientRect().height;

			var width = $(svg).get(0).getBoundingClientRect().width;

			var left = $(svg).position().left;

			var top = $(svg).position().top;

			var right = $(svg).position().right;

			var svgBlockTop = $('.svg-wrapper').offset().top;

			var svgBlockLeft = $('.svg-wrapper').offset().left;

			var svgBlockRight = $('.svg-wrapper').offset().right;

			$('.svg-tooltip').css('left', width - svgBlockLeft + left + 10);

			$('.svg-tooltip').css('top', top - svgBlockTop);

			$('.svg-tooltip').show();

		}

		else{

			$('.svg-tooltip').hide();

		}

	}



