function lkLinks(){

	// var list = $('.lk-links_list');

	var items = $('.lk-links_list__item');

	for (var i = items.length - 1; i >= 0; i--) {

		checkWrapperWidth(items[i]);

	};

}



function checkWrapperWidth(item){

	var listWidth = $('.lk-links_list').width();

	var wrapperWidth = $('.lk-links').width();

	var dropDownList = $('.js-lk-list-dropdown');

	if (listWidth > wrapperWidth - 50) {

		var link = $(item).find('a');

		$(dropDownList).append(`<li class="option"><a href="${link[0].href}">${link[0].innerText}</a></li>`);

		$(item).addClass('lk-links-hidden-link');

		

	}

}